import Link from 'next/link';

const Index = () => (
  <div>
    <NavBar/>
    <p>Hello Next.js</p>
  </div>
);

function NavBar(props) {
    return (
      <div>
        <Link href='/history'>
          <a title="History Page">History</a>
        </Link>
        <Link href='/group'>
          <a title="Group Page">Group</a>
        </Link>
        <Link href='/forum'>
          <a title="Forum Page">Forum</a>
        </Link>
      </div>
    );
}

export default Index;
